import React from "react";
import "./css/App.css";
import Main from "./Main";
import { ThemeProvider, createTheme } from "@mui/material/styles";
function App() {
  const theme = createTheme();
  return (
    <ThemeProvider theme={theme}>
      <div className="App" style={{ backgroundColor: "#fcfaea" }}>
        <Main />
      </div>
    </ThemeProvider>
  );
}

export default App;
